import React from 'react';
import './Footer.css'; // Certifique-se de que o caminho para o arquivo CSS está correto
import { Link } from 'react-router-dom';
function Footer() {
    return (
        <footer className="footer">
            <p>© 2024 Site e Sistema. Todos os direitos reservados.</p>
            <div className="footer-links">
                <Link to="/">Home</Link>
                <a href="#sobreEmpresa">Sobre a Empresa</a>
                <a href="#servicos">Serviços</a>
                {/*<a href="#portfolio" target="_blank" rel="noopener noreferrer">Portfólio</a>*/}
                <a href="#contato">Contato</a>
                <Link to="/portfolio">Portfólio</Link>
            </div>
        </footer>
    );
}

export default Footer;
